import React from 'react';

class Hello extends React.Component {
  render() {
    if(this.props.login){
      return(
        <h2> Cześć {this.props.login} ! </h2>
      );
    }
    else
    return(
    <h2> Hejka, może byś się zalogował? </h2>
    );
  }
}


export default Hello
